import React from "react";

export class ProfilePage extends React.Component {
    render() {    
        return (
            <div>
                <section>
                    <p><strong>User:</strong>*{props.user.name}*</p>
                </section>
                <section>
                <p><strong>Theme:</strong>*{this.state.theme}*</p>
                </section>
            </div>
        )
    }
}
